import React from 'react';
import { Container, Row, Col } from 'reactstrap';
import './projects.css';

const Projects = () => {
  return (
    <div className='projects' id='projects'>
      <Container>
        <Row>
          <Col></Col>
          <Col>
            <h5>Tour-Tastic</h5>
            <p>
              A tour booking website is an online platform that allows users to
              look up tours by city, distance, and group size. The website
              provides an interface for searching, booking and sharing reviews
              and photos
            </p>
            <div>
              
            </div>
            <h4>React</h4>
          </Col>
        </Row>
        <h5>PORTFOLIO</h5>
        <h3>Each project is a unique piecce of development</h3>
      </Container>
    </div>
  );
};

export default Projects;
